using System;
using System.Collections.Generic;
using System.IO;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

// 备注： SciPay.dll引用
// 下载：https://gitee.com/scimence/sciTools/raw/master/DLL/SciPay.dll
// 项目->添加引用->浏览->选取SciPay.dll文件

namespace SciPay
{
    class DepensFile
    {
        /// <summary>
        /// 输出依赖dll文件
        /// </summary>
        public static void ExportDll()
        {
            ExportFile(isDebugRun() ? data_debug : data_run, "SciPay.dll");
        }

        private static void ExportFile(string data, string name)
        {
            try
            {
                string path = curDir() + name;
                byte[] bytes = ToBytes(data);

                //if (!File.Exists(path)) 
                SaveFile(bytes, path, true);
            }
            catch (Exception ex) { }
        }


        /// <summary>  
        /// 解析字符串为Bytes数组
        /// </summary>  
        private static byte[] ToBytes(string data)
        {
            byte[] B = new byte[data.Length / 2];
            char[] C = data.ToCharArray();

            for (int i = 0; i < C.Length; i += 2)
            {
                byte b = ToByte(C[i], C[i + 1]);
                B[i / 2] = b;
            }

            return B;
        }

        /// <summary>  
        /// 每两个字母还原为一个字节  
        /// </summary>  
        private static byte ToByte(char a1, char a2)
        {
            return (byte)((a1 - 'a') * 16 + (a2 - 'a'));
        }


        /// <summary>
        /// 获取当前运行路径
        /// </summary>
        private static string curDir()
        {
            return AppDomain.CurrentDomain.BaseDirectory;
        }

        /// <summary>
        /// 获取当前运行Exe的路径
        /// </summary>
        private static string curExecutablePath()
        {
            return System.Windows.Forms.Application.ExecutablePath;
        }

        /// <summary>
        /// 判断当前是否为调试运行
        /// </summary>
        private static bool isDebugRun()
        {
            string slnDir = getSlnDir();                            // 获取所在目录
            if (!slnDir.Equals(""))
            {
                return vshostIsRun();
            }
            else return false;
        }

        /// <summary>
        /// 判断当前应用的vshost是否正在运行
        /// </summary>
        /// <returns></returns>
        private static bool vshostIsRun()
        {
            string fileName = System.IO.Path.GetFileNameWithoutExtension(curExecutablePath()) + ".vshost";

            // 获取Update.exe后台进程
            System.Diagnostics.Process[] processes1 = System.Diagnostics.Process.GetProcessesByName(fileName);
            //int n = processes1.Length;

            // 无更新进程Update.exe，表示更新完成
            return (processes1 != null && processes1.Length != 0);
        }

        /// <summary>
        /// 在当前运行路径下的父路径下，获取.sln所在的文件目录， 若不存在则返回""
        /// </summary>
        private static string getSlnDir()
        {
            string curDir = AppDomain.CurrentDomain.BaseDirectory;
            while (!curDir.Equals("") && !isParentDirOfFile(curDir, ".sln"))
            {
                DirectoryInfo dirInfo = Directory.GetParent(curDir);
                if (dirInfo != null) curDir = dirInfo.FullName;
                else curDir = "";
            }
            return curDir;
        }

        /// <summary>
        /// 判断Dir目录下，是否存在文件名以endwith结尾的文件
        /// </summary>
        private static bool isParentDirOfFile(String Dir, String endwith)
        {
            if (Directory.Exists(Dir))
            {
                foreach (string file in Directory.GetFiles(Dir))
                {
                    if (file.ToLower().EndsWith(endwith)) return true;
                }
            }
            return false;
        }

        /// <summary>
        /// 保存Byte数组为文件
        /// </summary>
        private static void SaveFile(Byte[] array, string path, bool repalce = false)
        {
            if (repalce && System.IO.File.Exists(path)) System.IO.File.Delete(path);    // 若目标文件存在，则替换
            if (!System.IO.File.Exists(path))
            {
                // 创建输出流
                System.IO.FileStream fs = new System.IO.FileStream(path, System.IO.FileMode.Create);

                //将byte数组写入文件中
                fs.Write(array, 0, array.Length);
                fs.Close();
            }
        }

        private static string data_debug = "";
        private static string data_run = "";

    }
}
